import React from 'react';
import './App.css';
import profile from './profile.jpg';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <div className="sliding-name-background">
          <div className="name-slide">DANNY GARCIA&nbsp;•&nbsp;DANNY GARCIA&nbsp;•&nbsp;DANNY GARCIA</div>
        </div>
        <div className="hero-container">
          <img src={profile} alt="Danny Garcia" className="profile-picture" />
          <div className="hero-text">
            <h1>Hi, I'm <span className="highlighted-name">Danny Garcia!</span></h1>
            <p>Frontend engineer with a passion for building delightful experiences.</p>
          </div>
        </div>
      </header>

      <main className="App-main">
        <section className="bio-section">
          <h2>Bio</h2>
          <p>
            Passionate software engineer with extensive experience in frontend development, creating seamless and visually engaging user experiences.
          </p>
        </section>
        {/* Add Experience and Projects sections as needed */}
      </main>
    </div>
  );
}

export default App;
